window.bookSummaryJSON = "<p>Have you noticed that people who regularly set goals are happier and healthier than the rest of the people you know? Understand why this is and how YOU can do it, as Zig Ziglar guides you through one of the world’s most popular goal achieving systems. </p> <p>This product is a collection of goal achievement programs from the leading experts on the subject. According to Brian Tracy, the top 2% earners from Harvard Business School are goal-setting masters. With Brian Tracy’s proven goal achieving system, you will clearly see how he has achieved multimillion-dollar successes in his life. Life can be a struggle and we often feel like giving up our dreams. Learn the psychological science of how to overcome all challenges along the path to achievement. </p> <p>Using the techniques in this program, you will be able to create boundaries around technology which will help clarify and simplify your life. Get unstuck and abandon your fears to set and achieve big goals!It doesn’t matter whether your goal is to become a millionaire—or a billionaire—or if you just want a bigger house, a nicer car, a better job, a healthier life, or a happier relationship. Discover the powerful tools you have been seeking to transform your life and your business.</p>"; 
